oxy_webhelp_navlinks = {"tocId-d1202e568":{"topics":[{"title":"Using Workspaces","href":"Chapter3\/Concepts\/C_using_workspaces.html","attributes":{"data-id":"C_Using_Workspaces"},"menu":{"hasChildren":true},"tocID":"C_Using_Workspaces-d1202e569","next":"C_Using_Workspaces-d1202e569"},{"title":"Opening a Workspace","shortdesc":"<p class=\"shortdesc\"\/>","href":"Chapter3\/Concepts\/C_opening_a_workspace.html","attributes":{"data-id":"C_opening_a_workspace"},"menu":{"hasChildren":true},"tocID":"C_opening_a_workspace-d1202e593","next":"C_opening_a_workspace-d1202e593"},{"title":"Opening a New Window","shortdesc":"<p class=\"shortdesc\">Have multiple workspaces open on your desktop at the same time by opening multiple         Marvel Enterprise Portal windows.<\/p>","href":"Chapter3\/Tasks\/T_opening_a_new_window.html","attributes":{"data-id":"t_opening_a_new_window"},"menu":{"hasChildren":false},"tocID":"t_opening_a_new_window-d1202e613","topics":[]},{"title":"Tabbed Workspaces","shortdesc":"<p class=\"shortdesc\">Use the tabbed pages capability of your browser to open workspaces, linked         workspaces, and Navigator views in new tabs.<\/p>","href":"Chapter3\/Concepts\/C_tabbed_workspaces.html","attributes":{"data-id":"c_tabbed_workspaces"},"menu":{"hasChildren":true},"tocID":"c_tabbed_workspaces-d1202e624","next":"c_tabbed_workspaces-d1202e624"},{"title":"Refreshing a Workspace","shortdesc":"<p class=\"shortdesc\">You can refresh the data that is displayed in the workspace on demand or at a set         interval.<\/p>","href":"Chapter3\/Tasks\/T_refreshing_a_workspace.html","attributes":{"data-id":"T_refreshing_a_workspace"},"menu":{"hasChildren":false},"tocID":"T_refreshing_a_workspace-d1202e683","topics":[]},{"title":"Suspending and Stopping Refresh","shortdesc":"<p class=\"shortdesc\">If the workspace is set to refresh automatically at timed intervals or it includes         event status views, you can suspend refreshes to keep the data from changing while you         investigate a problem.<\/p>","href":"Chapter3\/Tasks\/T_suspending_and_stopping_refresh.html","attributes":{"data-id":"T_suspending_and_stopping_refresh"},"menu":{"hasChildren":false},"tocID":"T_suspending_and_stopping_refresh-d1202e694","topics":[]},{"title":"Linking to a Workspace","shortdesc":"<p class=\"shortdesc\">Use these steps to link to a workspace that has been targeted from the current         Navigator item or view.<\/p>","href":"Chapter3\/Tasks\/T_linking_to_a_workspace.html","attributes":{"data-id":"T_linking_to_a_workspace"},"menu":{"hasChildren":false},"tocID":"T_linking_to_a_workspace-d1202e705","topics":[]},{"title":"View Title Bar and Toolbar","href":"Chapter3\/Concepts\/C_view_title_bar_and_toolbar.html","attributes":{"data-id":"c_view_title_bar_and_toolbar"},"menu":{"hasChildren":false},"tocID":"c_view_title_bar_and_toolbar-d1202e716","topics":[]},{"title":"Setting a Time Span to Display","shortdesc":"<p class=\"shortdesc\">You can have the Marvel Enterprise Portal log data samplings into history files or a         database for display in a table or chart. These historical data enabled views have a tool         for setting a range of previous data samples to be reported.<\/p>","href":"Chapter3\/Tasks\/T_setting_a_time_span_to_display.html","attributes":{"data-id":"t_setting_a_time_span_to_display"},"menu":{"hasChildren":false},"tocID":"t_setting_a_time_span_to_display-d1202e724","topics":[]},{"title":"Moving a View","shortdesc":"<p class=\"shortdesc\">Move a view to a different position in the workspace to take best advantage of the         available space.<\/p>","href":"Chapter3\/Tasks\/T_moving_a_view.html","attributes":{"data-id":"T_moving_a_view"},"menu":{"hasChildren":false},"tocID":"T_moving_a_view-d1202e735","topics":[]},{"title":"Reordering Columns and Rows","shortdesc":"<p class=\"shortdesc\">Change how a table view is sorted temporarily to focus on specific column details or         in a more permanent way if it should always appear sorted in this manner. You can also         reposition columns for a more logical organization or to emphasize columns of         interest.<\/p>","href":"Chapter3\/Tasks\/T_reordering_columns_and_rows.html","attributes":{"data-id":"t_reordering_columns_and_rows"},"menu":{"hasChildren":false},"tocID":"t_reordering_columns_and_rows-d1202e746","topics":[]},{"title":"Zooming a Chart View","shortdesc":"<p class=\"shortdesc\">Zoom in on part of a bar chart, plot chart, or area chart to see a subset of the data         in greater detail.<\/p>","href":"Chapter3\/Tasks\/T_zooming_a_chart_view.html","attributes":{"data-id":"T_zooming_a_chart_view"},"menu":{"hasChildren":false},"tocID":"T_zooming_a_chart_view-d1202e758","topics":[]},{"title":"Exporting a Query-based View","shortdesc":"<p class=\"shortdesc\">Save some or all of the data that was retrieved by the query for a view in a text         (.txt) file or comma separated value (.csv) file for further manipulation in another         software application.<\/p>","href":"Chapter3\/Tasks\/T_exporting_a_query_based_view.html","attributes":{"data-id":"T_exporting_a_query_based_view"},"menu":{"hasChildren":false},"tocID":"T_exporting_a_query_based_view-d1202e769","topics":[]},{"title":"Finding Text in a Browser View or Notepad View","shortdesc":"<p class=\"shortdesc\">Use the find function to locate text in the selected notepad view or browser         view.<\/p>","href":"Chapter3\/Tasks\/T_finding_text_in_a_browser_view_or_notepad_view.html","attributes":{"data-id":"T_finding_text_in_a_browser_view_or_notepad_view"},"menu":{"hasChildren":false},"tocID":"T_finding_text_in_a_browser_view_or_notepad_view-d1202e780","topics":[]},{"title":"Finding Table Data","shortdesc":"<p class=\"shortdesc\">Use the find function to locate a text or numeric value in the selected table view,         message log, or event console view.<\/p>","href":"Chapter3\/Tasks\/T_finding_table_data.html","attributes":{"data-id":"T_finding_table_data"},"menu":{"hasChildren":true},"tocID":"T_finding_table_data-d1202e791","next":"T_finding_table_data-d1202e791"},{"title":"Printing a View or Workspace","shortdesc":"<p class=\"shortdesc\">You can print the workspace or an individual view and display a preview         beforehand.<\/p>","href":"Chapter3\/Tasks\/T_printing_a_view_or_workspace.html","attributes":{"data-id":"T_printing_a_view_or_workspace"},"menu":{"hasChildren":false},"tocID":"T_printing_a_view_or_workspace-d1202e812","topics":[]}]}};